def fill_bucket(bucket, grid, row, col):
    bucket += grid[row][col]
    if bucket == capacity:
        return 1
    elif bucket > capacity:
        return 0
    else:
        return fill_bucket(bucket, grid, row, col + 1) + fill_bucket(bucket, grid, row + 1, 0)

return fill_bucket(0, grid, 0, 0)

